class Hello {

	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner) {
		this.log = log;
		this.context = context;
		this.testRunner = testRunner;
	}

	def sayHello(String name) {
		log.info("	Hello " + name);
	}
}

context.setProperty("Hello", new Hello(log, context, testRunner));

def testStep = testRunner.testCase.getTestStepByName("Hello");

testStep.run(testRunner, context);

context.Hello.sayHello("to Pete");

def project = testRunner.testCase.testSuite.project;

def tCase = project.testSuites["TestSuite3"].testCases["TestCase1"];

def hello = tCase.getTestStepByName("Hello");

hello.run(testRunner, context);

context.Hello.sayHello(" to Mum");

log.info testRunner.metaClass.methods*.name.unique().sort();

def tstep = testRunner.testCase.testSuite.project.testSuites["TestSuite3"].testCases["TestCase2"].getTestStepByName("CountryISOCode");
def status = tstep.run(testRunner, context)
def result = status.getStatus().toString();

log.info ("   ---- "+result)

def tCase = testRunner.testCase.testSuite.testCases["TestCase2"];

def prop = new com.eviware.soapui.support.types.StringToObjectMap();

def runner = tCase.run(null, false);

log.info("	>>> Results: " + runner.getStatus().toString());

def testCases = context.testCase.testSuite.getTestCaseList();
testCases.each{
	log.info(it.name)
}

def suite = context.testCase.testSuite.project.testSuites["TestSuite2"];
suite.run(null,false);
// null can be replaced with : new com.eviware.soapui.support.types.StringToObjectMap()
log.info ("   ===   "+suite.getName().toString()+" - Executed successfully")

def projectName=testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1");

def runner = projectName.run(null,true);

while (runner.getStatus().toString().equals("RUNNING")) {

}

log.info("	>>> Results: " + runner.getStatus().toString());
